import React from 'react';

export default function CartColumns(){

        return(
            <div className="myCart">
                <div className="container flexible head">
                    <p>Product</p>
                    <p>Name of Product</p>
                    <p>Price</p>
                    <p>Quantity</p>
                    <p>Remove</p>
                    <p>Total Item</p>
                </div>
            </div>
        )

}
